export const returnDeviceSearch = (searchDevice, deviceInfoType, string) => {
  let container = []
  searchDevice.forEach(profile => {
    profile.forEach(e => {
      if (e.data.toString().toLowerCase().includes(string)) {
        deviceInfoType.push(e.type);
        container.push(profile);
      }
    });
  });
  return [...new Set(container)];
}
